import {GET_ERRORS} from "../Types/Types";


const initialState = {};


export default function(state = initialState, action) {

    console.log("ERROR reducer method")
    switch (action.type) {
        case GET_ERRORS:
            console.log("ERROR reducers")
            return action.payload;
        default:
            return state;
    }
}
